var btnContainer = document.getElementById('button-container');
var btn = document.getElementById('play-btn');
var video = document.getElementById('server-video');
video.addEventListener('canplay', (evt) => { // canplaythrough complete durationchange emtied ended error loadeddata loadedmetadata loadstart pause play playing progress ratechange seeked seeking stalled suspend timeupdate volumechange waiting
    btnContainer.style = 'display: none;';
    video.play();
});
video.addEventListener('ended', (evt) => {
    video.src = null;
    btnContainer.style = 'display: initial;';
});
btn.addEventListener('click', (evt) => {
    video.src = 'video/cat_error.mp4';
});
